def swap(param):
    vals = param.split()

    not_results = []

    for bin_val in vals:
        not_result = ''.join(['1' if bit == '0' else '0' for bit in bin_val])
        not_results.append(not_result)

    final_result = ' '.join(not_results)

    return final_result

